window.bookSummaryJSON = "<p><b>This set contains all three books in the best-selling Dark Elite series. Dive into a world of violence, obsession, heart-twisting angst, and dangerous romance. Complete trilogy with a happily ever after!</b></p> <p>They say the devil goes by many names, and I know four of them: Ciro, Hale, Zaid, and Lucas.&nbsp;</p> <p>My father was once a powerful player in the Chicago underground, but six years ago, he left that life behind.&nbsp;</p> <p>We changed our names.&nbsp;</p> <p>Our identities.&nbsp;</p> <p>Our lives.&nbsp;</p> <p>The ghosts of the past never forgot him, though. They never forgot me.&nbsp;</p> <p>Dad promised me we were safe, but I should’ve known that was just another one of his lies.&nbsp;</p> <p>The past <i>always</i> finds you, and mine finds me on my wedding day when four brutal, dangerous men drag me from the altar in a hail of gunfire.</p> <p>Four men who used to be four boys.&nbsp;</p> <p>Four boys I cared about.&nbsp;</p> <p>Four boys I left behind.&nbsp;</p> <p>They’re not the same boys I knew, though, and whatever we may have once been to each other, it doesn’t matter anymore.&nbsp;</p> <p>Because they’re only one thing to me now: my captors.&nbsp;</p> <p><i>This is a reverse harem new adult dark romance series that includes high steam, violence, and foul language. </i></p> <p><b>Books in this set:</b></p> <ul> <li><i>Vicious Kings</i></li> <li><i>Ruthless Knights</i></li> <li><i>Savage Queen</i></li> </ul>"; 
